  false,\n\t\"url\": null,\n\t\"notes\": \"This Light Detection and Ranging (LiDAR)
  LAS dataset is a topographic survey conducted for the St. Louis District of the
  Army Corps of Engineers and the US Department of Agriculture (USDA) Natural Resources
  Conservation Service (NRCS) of Pine County, Minnesota. The data were collected October
  25 - November 4, 2006. The data cover approximately 1435 square miles and were collected
  at an average of 3 meters point spacing. The LAS points in this data set are classified
  as unclassified and ground. A footprint of the coverage for this data set may be
  viewed in Google Earth at: https://coast.noaa.gov/htdata/lidar1_z/geoid12a/data/533/supplemental/2006_Pine_County_Minnesota_Lidar.kmz\",\n\t\"license_title\":
